import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

const styles = StyleSheet.create({
	container: {
		backgroundColor: '#fff',
	},
	appbar: {
		backgroundColor: '#58e',
		padding: 30
	},
	title: {
		fontSize: 30,
		fontWeight: "bold",
		color: "white"
	},
	item: {
		padding: 20,
		fontSize: 24,
		borderBottomColor: '#ccc'
	}
});

function App() {
	return (
		<View style={styles.container}>
			<View style={styles.appbar}>
				<Text style={styles.title}>Native Toto</Text>
			</View>
			<View style={styles.list}>
				<View style={styles.item}><Text>Item One</Text></View>
				<View style={styles.item}><Text>Item Two</Text></View>
			</View>
		</View>
	);
}

export default App;
